using FakeXrmEasy;
using Insight.Intake.Plugin.Note;
using Insight.Intake.UnitTests.Fakes;
using Microsoft.Xrm.Sdk;
using Microsoft.Xrm.Sdk.Client;
using Microsoft.Xrm.Sdk.Query;
using System;
using System.Collections.Generic;
using Xunit;
using System.Linq;

namespace Insight.Intake.UnitTests.Plugin.Note
{
    public class GeneratePDFPatientStatementTest : PluginTestsBase
    {
        [Fact]
        public void CheckA2PDFPatientStatement()
        {

            var fakedContext = new XrmFakedContext();
            var documentBody = @"";

            ipg_documenttype documentType = new ipg_documenttype()
            {
                Id = Guid.NewGuid(),
                ipg_DocumentTypeAbbreviation = "PST"
            };

            ipg_document document = new ipg_document()
            {
                Id = Guid.NewGuid(),
                ipg_DocumentTypeId = documentType.ToEntityReference()
            };

            Annotation annotation = new Annotation()
            {
                Id = Guid.NewGuid(),
                ObjectId = document.ToEntityReference(),
                DocumentBody = documentBody
            };

            Incident incident = new Incident()
            {
                Id = Guid.NewGuid(),
                Title = "228427",
                ipg_ProcedureName = ""
            };

            Intake.Product product = new Intake.Product()
            {
                ProductId = Guid.NewGuid(),
                Name = "Test"
            };

            ipg_casepartdetail casePartDetail = new ipg_casepartdetail()
            {
                Id = Guid.NewGuid(),
                ipg_caseid = incident.ToEntityReference(),
                StateCode = (int)ipg_casepartdetailState.Active,
                ipg_productid = product.ToEntityReference()

            };

            ipg_globalsetting globalSetting = new ipg_globalsetting()
            {
                Id = Guid.NewGuid(),
                ipg_name = "A2_PDF_TEMPLATE"
            };

            Annotation annotationTemplate = new Annotation()
            {
                Id = Guid.NewGuid(),
                ObjectId = globalSetting.ToEntityReference(),
                DocumentBody = ""
            };

            fakedContext.Initialize(new List<Entity> { documentType, document, annotation, incident, product, casePartDetail, globalSetting, annotationTemplate });

            var inputParameters = new ParameterCollection { { "Target", annotation } };

            var pluginContext = new XrmFakedPluginExecutionContext()
            {
                MessageName = MessageNames.Create,
                Stage = PipelineStages.PostOperation,
                PrimaryEntityName = Annotation.EntityLogicalName,
                InputParameters = inputParameters
            };

            fakedContext.ExecutePluginWith<GeneratePDFPatientStatement>(pluginContext);

            var fakedService = fakedContext.GetOrganizationService();
            var crmContext = new OrganizationServiceContext(fakedService);

            var doc = (from d in crmContext.CreateQuery<ipg_document>()
                        where d.ipg_CaseId.Id == incident.Id
                        select d).FirstOrDefault();
            Assert.NotNull(doc);
            Assert.Contains("A2.pdf", doc.ipg_name);
        }

    }
}
